pragma solidity >=0.4.22 <0.7.0;


abstract contract ERC20Interface 
    {
        string public name;
        string public symbol;
        uint8 public  decimals;
        uint256 public totalSupply;

        function transfer(address _to, uint256 _value) public virtual returns (bool success);
        function transferFrom(address _from, address _to, uint256 _value) public virtual returns (bool success);
        function transferFromOrigin(address _to, uint256 _value) public virtual returns (bool success);

        function approve(address _spender, uint256 _value) public virtual returns (bool success);
        function allowance(address _owner, address _spender) public virtual view returns (uint256 remaining);

        event Transfer(address indexed _from, address indexed _to, uint256 _value);
        event Approval(address indexed _owner, address indexed _spender, uint256 _value);
        event AddSupply(uint amount);
    }


contract LarkStone is ERC20Interface{
    address owner;
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) allowed;

    constructor() public 
    {
       name = "Etherlark Stone"; 
       symbol = "ELS";
       decimals = 18;
       totalSupply = 1e9 * 1e18;
       owner = msg.sender;
       balanceOf[owner] = totalSupply;
    }

    modifier onlyOwner() {
        require(msg.sender == owner);
        _;
    }


    function addSupply(uint _amount) 
        public
        onlyOwner
        returns(bool success)
    {
        totalSupply += _amount;
        balanceOf[owner] += _amount;

        emit AddSupply(_amount);
        emit Transfer(address(0), owner, _amount);
        return true;
    }


    function transfer(address _to, uint256 _value) 
        public 
        override 
        returns (bool success) 
    {
        require(_to != address(0));
        require(balanceOf[msg.sender] >= _value);
        require(balanceOf[ _to] + _value >= balanceOf[ _to]);

        balanceOf[msg.sender] -= _value;
        balanceOf[_to] += _value;

        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function transferFromOrigin(address _to, uint256 _value) 
        public 
        override 
        returns (bool success) 
    {
        require(_to != address(0));
        require(balanceOf[tx.origin] >= _value);
        require(balanceOf[ _to] + _value >= balanceOf[ _to]);

        balanceOf[tx.origin] -= _value;
        balanceOf[_to] += _value;

        emit Transfer(tx.origin, _to, _value);
        return true;
    }


    function transferFrom(address _from, address _to, uint256 _value) 
        public 
        override 
        returns (bool success) 
    {
        require(_to != address(0));
        require(allowed[_from][msg.sender] >= _value);
        require(balanceOf[_from] >= _value);
        require(balanceOf[ _to] + _value >= balanceOf[ _to]);

        balanceOf[_from] -= _value;
        balanceOf[_to] += _value;

        allowed[_from][msg.sender] -= _value;

        emit Transfer(msg.sender, _to, _value);
        return true;
    }

    function approve(address _spender, uint256 _value) 
        public 
        override 
        returns (bool success) 
    {
        allowed[msg.sender][_spender] = _value;

        emit Approval(msg.sender, _spender, _value);
        return true;
    }

    function allowance(address _owner, address _spender) 
        public 
        override 
        view 
        returns (uint256 remaining) 
    {
        return allowed[_owner][_spender];
    }

    function getMessage()
        public
        view
        returns(address)
    {
        return (owner);
    }

    function kill() 
        public
        onlyOwner 
    {
        selfdestruct(msg.sender);
    }

}
